import React from 'react'

import './Nav.css'
import Video from './Video'

export const AdminVideo = ({state}) => {


    const allVideo=Object.keys(state)
.map(items =>{console.log(items)
            return
             <Video key={items} video={items}/>
    })
   
    return (
        <div className='cards'>
           {allVideo}
        </div>
    )
}


export default AdminVideo
